import React, { Component } from "react";
import { connect } from "react-redux";
import {
  Button,
  Container,
  Form,
  Row,
  Col,
  FormGroup,
  Nav,
  NavItem
} from "react-bootstrap";
import "../../css/grubhub.css";
import "bootstrap/dist/css/bootstrap.min.css";

class OwnerSignUp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isVisible: true
    };
  }

  render() {
    return (
      <div>
        <div class="row">
          <div class="col-sm-3">
            <nav id="mainNavbar">
              <ul class="nav nav-pills nav-stacked">
                <li class="active">
                  <a href="#divDesert">Desert</a>
                </li>
                <li>
                  <a href="#divLighthouse">Lighthouse</a>
                </li>
                <li>
                  <a href="#divTulips">Tulips</a>
                </li>
                <li class="dropdown">
                  <a href="#" class="dropdown-toggle" data-toggle="dropdown">
                    Animals <span class="caret"></span>
                  </a>
                  <ul class="dropdown-menu">
                    <li>
                      <a href="#divJellyfish">Jellyfish</a>
                    </li>
                    <li>
                      <a href="#divPenguins">Penguins</a>
                    </li>
                  </ul>
                </li>
              </ul>
            </nav>
          </div>
          <div class="col-sm-9">Main content goes here</div>
        </div>
      </div>
    );
  }
}
function mapStoreToProps(state) {
  return state;
}
export default connect(mapStoreToProps)(OwnerSignUp);
